import { Link } from "react-router-dom";
import Card from "../UI/Card";
import backgroundImage from "../../images/banner1.jpg";
import styles from "./SignupForm.module.css";

const SignupForm = () => {
  return (
    <>
      <div
        className={`py-5 ${styles["signup-container"]}`}
        style={{
          backgroundImage: `url(${backgroundImage})`,
          backgroundSize: "cover",
        }}
      >
        <div
          className={`container d-flex align-items-center justify-content-center ${styles["form-container"]}`}
        >
          <Card className="py-5 w-50 text-center">
            <h2 className="ms-3">Sign up</h2>
            <form>
              <div>
                <input type="text" className="ms-3" placeholder="Full Name" />
              </div>
              <div>
                <input type="text" className="ms-3" placeholder="Email" />
              </div>
              <div>
                <input type="text" className="ms-3" placeholder="Password" />
              </div>
              <div>
                <input type="text" className="ms-3" placeholder="Phone" />
              </div>
              <button className="ms-3">Sign up</button>
              <p className="ms-3">
                Login? <Link>Click</Link>
              </p>
            </form>
          </Card>
        </div>
      </div>
    </>
  );
};

export default SignupForm;
